function addSongToQueue(platform, songInfo) {
  console.log(platform);
  console.log(songInfo);
  global.sessionQueue.push([platform, songInfo]);

  console.log(global.sessionQueue);
}
exports.addSongToQueue = addSongToQueue;

function addPlaylistToQueue(platform, playlistInfo) {
  console.log(platform);
  console.log(playlistInfo);
}
exports.addPlaylistToQueue = addPlaylistToQueue;
